webpackJsonp([0x61251006d456],{328:function(t,e){t.exports={data:{markdownRemark:{id:"/Users/benjaminmodayil/Documents/sites/modayilme_gatsby/src/pages/posts/blog/09-22-2017-a-new-way-todo/index.md absPath of file >>> MarkdownRemark",html:'<p>Creating todos are one of my favorite things todo and most likely they are yours as well. For a whole lot of us there is a joyous feeling of being organized and having things that make us feel busy. But simply, we hate actually doing them.</p>\n<p>Unless those todos relate themselves to a passion, they will most likely not get done on time… or ever. The worst part about it all is that when we see long lists of todo items we get overwhelmed and slightly depressed when we don’t aren’t actually completing anything.</p>\n<p>I always tell myself that finding the right todo application will actually make me productive. That it will make me want to get stuff done.</p>\n<p>I’ve actually bought and downloaded multiple types of todo list applications over the last few years. None of them changed me, and in turn, I’ve given up on general todo lists that were designed to be used in a particular way.</p>\n<blockquote>\n<p>I’m tired of using a todo list as an excuse to not getting things done.</p>\n</blockquote>\n<p>I think we need to stop treating a todo list as a life changing object. Todo lists won’t change our desire to be productive. Only practicing being productive will make us productive.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.51820728291317%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Excel for ToDos"\n        title=""\n        src="/static/59db0ca8a4ff736fcadac9d57ce78cdf-8be62.png"\n        srcset="/static/59db0ca8a4ff736fcadac9d57ce78cdf-f3265.png 200w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-d937d.png 400w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-8be62.png 800w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-99f60.png 1200w,\n/static/59db0ca8a4ff736fcadac9d57ce78cdf-3002f.png 1428w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>At the moment, I’m trying to not let a application define my mood. At the moment, I’ll just stick with Excel until I find a better practice.</p>',frontmatter:{title:"A New Way ToDo",tldr:"Ben tries todo things",path:"/blog/a-new-way-todo"}}},pathContext:{path:"/blog/a-new-way-todo",_PARENT:"SOURCE"}}}});
